oy = my;
oz = mz;

oz = oz - 2;
x = ox*fov/oz + 0.5;
x = (x-.5)*0.75 + 0.5;
y = oy*fov/oz + 0.5;

r = 1;
g = .25+.25*sin(sp);
b = 0;
a = .5 + (oz+2)*.5;
a = a*below(z,2);
minrgb = min(r,min(g,b));
maxrgb = max(r,max(g,b));
